import React from 'react';
import {
    GoogleLogin,
    GoogleLoginResponse,
    GoogleLoginResponseOffline,
} from 'react-google-login';
import axios from 'axios';

const App: React.FC = () => {
    const handleLoginSuccess = async (
        response: GoogleLoginResponse | GoogleLoginResponseOffline
    ) => {
        if ('tokenId' in response) {
            const { tokenId } = response;
            try {
                const res = await axios.post(
                    'http://localhost:3000/authentication/google',
                    { token: tokenId }
                );
                console.log('Login successful:', res.data);
            } catch (error) {
                console.error('Login failed:', error.response?.data || error.message);
            }
        } else {
            console.error('Login failed: No tokenId found in response');
        }
    };

    const handleLoginFailure = (response: any) => {
        if (response.error === 'popup_closed_by_user') {
            console.error('Login failed: The popup was closed before completing the sign-in.');
        } else {
            console.error('Login failed:', response);
        }
    };

    return (
        <div className='App'>
            <h1>Google Authentication</h1>
            <GoogleLogin
                clientId='1079032050078-rvjpv3dikni78v74nkvn78eingk5sp1u.apps.googleusercontent.com'
                buttonText='Login with Google'
                onSuccess={handleLoginSuccess}
                onFailure={handleLoginFailure}
                cookiePolicy={'single_host_origin'}
            />
        </div>
    );
};

export default App;
